function SVG(props) {

  if (props.isHidden) {
    return <svg display='none'>{props.children}</svg>
  }

  let file = files[props.id]

  if (!file) return null

  let viewBox = file.viewBox
    ? file.viewBox.join(" ")
    : "0 0 " + props.width + " " + props.height

  return props.isHidden
    ? <svg display='none'>{props.children}</svg>
    : (
      <svg
        xmlns='http://www.w3.org/2000/svg'
        version='1.1'
        preserveAspectRatio='xMinYMin'
        viewBox={viewBox}
      >
        <use xlinkHref={"#" + prefix + "-" + props.id} />
      </svg>
    )

}


function SVGSource() {

  return (
    <SVG isHidden={true}>
      <defs>
        {Object.keys(files).reduce((defs, fileId, fileIndex) => {
          const file = files[fileId]
          return defs.concat(
            <g
              key={fileIndex}
              id={prefix + "-" + fileId}
              dangerouslySetInnerHTML={{ __html: file.data }}
            >
            </g>
          )
        }, [])}
      </defs>
    </SVG>
  )

}


export {
  SVG,
  SVGSource
}
